#define MDL_START  /* Change to #undef to remove function */
#if defined(MDL_START)
  /* Function: mdlStart =======================================================
   * Abstract:
   *    This function is called once at start of model execution. If you
   *    have states that should be initialized once, this is the place
   *    to do it.
   */
static void mdlStart(SimStruct *S)
{
    /* Bus Information */
    slDataTypeAccess *dta = ssGetDataTypeAccess(S);
    const char *bpath = ssGetPath(S);
	DTypeId AtmosphereBusId = ssGetDataTypeId(S, "AtmosphereBus");
	DTypeId EnvironmentBusId = ssGetDataTypeId(S, "EnvironmentBus");

	int_T *busInfo = (int_T *)malloc(12*sizeof(int_T));
	if(busInfo==NULL) {
        ssSetErrorStatus(S, "Memory allocation failure");
        return;
    }

      /* Calculate offsets of all primitive elements of the bus */

	busInfo[0] = dtaGetDataTypeElementOffset(dta, bpath,EnvironmentBusId,0);
	busInfo[1] = 3 * dtaGetDataTypeSize(dta, bpath, ssGetDataTypeId(S, "double"));
	busInfo[2] = dtaGetDataTypeElementOffset(dta, bpath,EnvironmentBusId,2);
	busInfo[3] = 3 * dtaGetDataTypeSize(dta, bpath, ssGetDataTypeId(S, "double"));
	busInfo[4] = dtaGetDataTypeElementOffset(dta, bpath,EnvironmentBusId,1) +dtaGetDataTypeElementOffset(dta, bpath,AtmosphereBusId,0);
	busInfo[5] = dtaGetDataTypeSize(dta, bpath, ssGetDataTypeId(S, "double"));
	busInfo[6] = dtaGetDataTypeElementOffset(dta, bpath,EnvironmentBusId,1) +dtaGetDataTypeElementOffset(dta, bpath,AtmosphereBusId,1);
	busInfo[7] = dtaGetDataTypeSize(dta, bpath, ssGetDataTypeId(S, "double"));
	busInfo[8] = dtaGetDataTypeElementOffset(dta, bpath,EnvironmentBusId,1) +dtaGetDataTypeElementOffset(dta, bpath,AtmosphereBusId,2);
	busInfo[9] = dtaGetDataTypeSize(dta, bpath, ssGetDataTypeId(S, "double"));
	busInfo[10] = dtaGetDataTypeElementOffset(dta, bpath,EnvironmentBusId,1) +dtaGetDataTypeElementOffset(dta, bpath,AtmosphereBusId,3);
	busInfo[11] = dtaGetDataTypeSize(dta, bpath, ssGetDataTypeId(S, "double"));
	ssSetUserData(S, busInfo);


}
#endif /*  MDL_START */

