/* Function: mdlOutputs =======================================================
 *
*/
static void mdlOutputs(SimStruct *S, int_T tid)
{
    const real_T   *Actuators  = (const real_T*) ssGetInputPortSignal(S,0);
    const char *Environment = (char *) ssGetInputPortSignal(S,1);
    const real_T   *ActuatorsTrim  = (const real_T*) ssGetInputPortSignal(S,2);
    const real_T   *AirDensityTrim  = (const real_T*) ssGetInputPortSignal(S,3);
    const real_T   *AirTempTrim  = (const real_T*) ssGetInputPortSignal(S,4);
    const real_T   *PressureTrim  = (const real_T*) ssGetInputPortSignal(S,5);
    const real_T   *SpeedOfSoundTrim  = (const real_T*) ssGetInputPortSignal(S,6);
    const real_T   *GravityNEDTrim  = (const real_T*) ssGetInputPortSignal(S,7);
    const real_T   *MagneticFieldNEDTrim  = (const real_T*) ssGetInputPortSignal(S,8);
    real_T        *y  = (real_T *)ssGetOutputPortRealSignal(S,0);


	int_T* busInfo = (int_T *) ssGetUserData(S);

	/* Temporary bus copy declarations */
	EnvironmentBus _u1BUS;

	/*Copy input bus into temporary structure*/
	(void) memcpy(_u1BUS.Gravity_ned,Environment + busInfo[0], busInfo[1]);
	(void) memcpy(_u1BUS.MagneticField_ned,Environment + busInfo[2], busInfo[3]);
	(void) memcpy(&_u1BUS.AtmosphereBus.air_temp,Environment + busInfo[4], busInfo[5]);
	(void) memcpy(&_u1BUS.AtmosphereBus.speed_sound,Environment + busInfo[6], busInfo[7]);
	(void) memcpy(&_u1BUS.AtmosphereBus.pressure,Environment + busInfo[8], busInfo[9]);
	(void) memcpy(&_u1BUS.AtmosphereBus.air_density,Environment + busInfo[10], busInfo[11]);
	
	linearInputBus_Outputs_wrapper(Actuators,&_u1BUS, ActuatorsTrim, AirDensityTrim, AirTempTrim, PressureTrim, SpeedOfSoundTrim, GravityNEDTrim, MagneticFieldNEDTrim, y);

	/*Copy temporary structure into output bus*/


}



